  \"2016-05-09T20:23:02.574309\",\n\t\"name\": \"seamap-groundfish-shrimp-trawl-red-snapper-analytical-dataset-provided-to-nrda\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Southeast Fisheries Science Center
  Mississippi Laboratories has conducted standardized groundfish trawl surveys in
  the Gulf of Mexico since 1987.  Prior to 1987, the summer survey was conducted under
  Southeast Area Monitoring and Assessment Program (SEAMAP) protocols; however, the
  fall survey operated independent of SEAMAP and dates back to 1972.  Data from these
  standardized surveys were provided to the Natural Resources Damage Assessment (NRDA)
  to support assessment of the environmental impacts of the Deepwater Horizon oil
  spill which occurred in the Gulf of Mexico in 2010.\",\n\t\"license_title\": null,\n\t\"extras\":
